import React from 'react';
import Message from './Message/Message';

const Messages = ({messages}) => {
  return (
    <div>
      <div className='item__message'>
        <ul>
          {messages.map((message, i) => <div key={i}><Message message={message}/></div>)}
        </ul>
      </div>
    </div>
  )
}

export default Messages;
